import React from 'react';
import './NotFoundPage.css';

const NotFoundPage = () => (
  <div className="not-found-page">
    <h2>Page Not Found</h2>
    <p>We couldn't find the page you were looking for.</p>
  </div>
);

export default NotFoundPage;
